function rowCreate(size) {
    for (var i = 0; i<size; i++){
        var row = tbl.insertRow(-1);
        var cell1 = row.insertCell(0);
        var cell2 = row.insertCell(1);
        var cell3 = row.insertCell(2);
        var cell4 = row.insertCell(3);
        var cell5 = row.insertCell(4);
        
        let rank = i+1;
        cell1.innerHTML = "#" + rank;
        cell2.innerHTML= "<img src=" + "heroImages/" + data10[i]['HeroID'] +  ".png" + ">";
        
        var Rect = document.createElement("div");
        var RectWidth = data10[i]['WinRate'] * numSizeWin;
        var RectHeight = data10[i]['PlayRate'] * numSizePlay;
        Rect.style = "width:" + RectWidth + "px;height:" +  RectHeight + "px; background:#1cd93c;"
        cell3.appendChild(Rect);
    
        var neededGames = 100/data10[i]['PlayRate'] ;
        cell4.innerHTML = data10[i]['WinRate'] + "%" + "<br> 1 in " + neededGames;
        cell5.innerHTML = data10[i]['Point']; 
    };
};
   


function listToMatrix(list, elementsPerSubArray) {
    var matrix = [], i, k;

    for (i = 0, k = -1; i < list.length; i++) {
        if (i % elementsPerSubArray === 0) {
            k++;
            matrix[k] = [];
        }

        matrix[k].push(list[i]);
    }

    return matrix;
}

